			shellScript = "#This script builds all configurations of the syslist installation package\n\n\n# This function builds a configuration of the \nfunction BuildPackage() {\n\n\t# $1 is Dest/To Dir Name\n\t# $2 is Source/From Dir Name\n\n\tDEST_DIR=\"${COMMON_DIR}/${1}_Package\"\n\tIMAGE_DIR=\"${COMMON_DIR}/${1}_Image\"\n\tFINAL_DIR=\"${IMAGE_DIR}/SCA_Install.pkg\"\n\n\tSOURCE_DIR=\"${COMMON_DIR}/$2\"\n\n\tDISK_NAME=\"SyslistAgent${3}_${VERSION_EXT}\"\n\n\tDISK_LOC=\"${COMMON_DIR}/${DISK_NAME}.dmg\"\n\n\techo \"Building Package Source: ${SOURCE_DIR} Dest: ${DEST_DIR}\"\n\n\tDEST_APPS_DIR=\"${DEST_DIR}/Applications/Syslist Companion Agent\"\n\tDEST_DAEMON_DIR=\"${DEST_DIR}/Library/StartupItems/SyslistExecutionTimer\"\n\n\t# remove existing destination directory - chown 'cause we set then to root on build\n\tsudo chown -R \"${USER}\" \"${DEST_DIR}\"\n\trm -rf \"${DEST_DIR}\"\n\n\t# and remake it anew!\n\tmkdir \"${DEST_DIR}\"\n\t\n\t# make needed subdirectories for package structure\n\tmkdir -p \"${DEST_APPS_DIR}\"\n\tmkdir -p \"${DEST_DAEMON_DIR}\"\n\n\t# copy common application items into apps package infrastructure\n\tcp \"${COMMON_DIR}/Deployment/SCATimeEx\" \"${DEST_APPS_DIR}\"\n\n\t# copy specific application items into apps package infrastructure\n\tcp \"${SOURCE_DIR}/Deployment/SCACollector\" \"${DEST_APPS_DIR}\"\n\tcp -r \"${SOURCE_DIR}/Deployment/SCAConfig.app\" \"${DEST_APPS_DIR}\"\n\n\t# Uninstall items - applescript must be built before calling\n\tcp Install/uninstall.sh \"${DEST_APPS_DIR}\"\n\tcp -r \"${COMMON_DIR}/Uninstall Syslist Agent.app\" \"${DEST_APPS_DIR}\"\n\t\n\t# Set Apps permissions to group and user for read, write and execute\n\n\tchmod -R 770 \"${DEST_DIR}\"\n\tchgrp -R admin \"${DEST_DIR}\"\n\tsudo chown -R root \"${DEST_APPS_DIR}\"\n\n\tchmod -R 770 \"${DEST_APPS_DIR}\"\n\tchgrp -R admin \"${DEST_APPS_DIR}\"\n\tsudo chown -R root \"${DEST_APPS_DIR}\"\n\n\t# Daemon/Startup executable and Info files\n\tcp TimedExec/StartupParameters.plist \"${DEST_DAEMON_DIR}\"\n\tcp TimedExec/SyslistExecutionTimer \"${DEST_DAEMON_DIR}\"\n\n\t# Daemon permissions\n\tchmod 755 \"${DEST_DAEMON_DIR}/SyslistExecutionTimer\"\n\tchmod 744 \"${DEST_DAEMON_DIR}/StartupParameters.plist\"\n\tchmod 755 \"${DEST_DAEMON_DIR}\"\n\tsudo chgrp -R wheel \"${DEST_DAEMON_DIR}\"\n\tsudo chown -R root \"${DEST_DAEMON_DIR}\"\n\tls -ld \"${DEST_DAEMON_DIR}\"\n\tsudo ls -ld \"${DEST_DAEMON_DIR}\"\n\n\t# remove old package first and make anew\n\trm -rf \"${IMAGE_DIR}\"\n\tmkdir -p \"${IMAGE_DIR}\"\n\n\t# final install package build\n\t/Xcode2.5/Applications/Utilities/PackageMaker.app/Contents/MacOS/PackageMaker -build -p \"${PWD}/${FINAL_DIR}\" -f \"${PWD}/${DEST_DIR}\" -r \"${PWD}/Install/Resources\" -i \"${PWD}/Install/InstallPkgInfo.plist\" -d \"${PWD}/Install/InstallDesc.plist\"\n\n\t#/Developer/Applications/Utilities/PackageMaker.app/Contents/MacOS/PackageMaker -o \"${PWD}/${FINAL_DIR}\" -r \"${PWD}/${DEST_DIR}\"  -e \"${PWD}/Install/Resources\" --target 10.3 -f \"${PWD}/Install/InstallPkgInfo.plist\" --root-volume-only -v\n\n\t# and now finally, the disk image\n\trm -rf \"${DISK_LOC}\"\n\thdiutil create -srcfolder \"${IMAGE_DIR}\" -volname \"${DISK_NAME}\" -fs HFS+ \"${DISK_LOC}\" -format UDRW\n\n\techo \"Package $1 Build Complete!\"\n\treturn 0\n}\n\n#This is the central location in which all build products end up\nCOMMON_DIR=build\nVERSION_EXT=1_1_5\n\necho \"Common Directory is ${COMMON_DIR}\"\n\n# Base work and repition of building the different configurations\necho \"Working Directory is \" `pwd`\n\n# build the common uninstall application\nosacompile -d -o \"${COMMON_DIR}/Uninstall Syslist Agent.app\" \"Install/Uninstall Syslist Agent.applescript\"\n\n# Package 'em all\nBuildPackage SCA BASE \"\"\nBuildPackage SCA_ASP ASP _ASP\nBuildPackage SCA_DEMO DEMO _DEMO\nBuildPackage SCA_ASP_DEMO ASP_DEMO _ASP_DEMO\n\n# Package the BSA items\necho \"Packaging BSA\"\n\nrm -f ${COMMON_DIR}/BSAUtil.app.zip\nzip -r ${COMMON_DIR}/BSAUtil.app.zip ${COMMON_DIR}/BSA/Deployment/BSAUtil.app \n\necho \"BUILD IS COMPLETE!\"\n\nexit 0";
		};
